import React from 'react';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
import Form from 'react-bootstrap/Form';

class AssistiveDevices extends React.Component {
    render() {
        return (

          <Form classname="container" formtext-padding="10 px">
              <Form.Label>Assistive Devices (check all that apply)</Form.Label>

                {['checkbox'].map((type) => (
                <div key={'Walker'} className="mb-3">
                <Form.Check 
                type={type}
                id={type}
                label={'Walker'}
                />
                </div>
                ))}

                {['checkbox'].map((type) => (
                <div key={'Wheelchair'} className="mb-3">
                <Form.Check 
                type={type}
                id={type}
                label={'Wheelchair'}
                />
                </div>
                ))}

                {['checkbox'].map((type) => (
                <div key={'Prosthetic'} className="mb-3">
                <Form.Check 
                type={type}
                id={type}
                label={'Prosthetic'}
                />
                </div>
                ))} 

                {['checkbox'].map((type) => (
                 <div key={'Prosthetic'} className="mb-3">
                <Form.Check 
                type={type}
                id={type}
                label={'Prosthetic'}
                />
                </div>

                ))}             


                </Form>
            )
                }}

  export default AssistiveDevices;
